import React, {useState} from "react";
import { CartProvider, useCart } from "react-use-cart";

function Cart(){
    const {
        isEmpty,
        totalUniqueItems,
        items,
        updateItemQuantity,
        removeItem
    } = useCart();
    <div className="emptyCartDiv">
    if(isEmpty) return <h1 className="emptyCart">Your Cart is Empty</h1>
    </div>
    return(
        <section>
            <div className="cartRow1">
                <h1 className="addCartHeading">Welcome to Cart Page</h1>
            </div>
        </section>
    )
}
export default Cart;
